import React from 'react';
import TableWithData from '../css/TableWithData.css';
const YourComponent = () => {
  // Sample data
  const data = [
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 2', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 3', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },

    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 5', column2: 'Data 2', column3: 'Data 3' },

    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },
    { column1: 'Data 1', column2: 'Data 2', column3: 'Data 3' },

    // Add more data items as needed
  ];

  return (
    <div>
      <h1>Your Table</h1>
      <TableWithData data={data} itemsPerPage={5} />
    </div>
  );
};

export default YourComponent;
